/**
 * 
 * @param {string} url 
 * @returns Number[][]
 */

export function UrlParser(url){
    let code = url.trim().split('=')[1];
	let matrix = [];
	for (let i = 0; i < 9; i++) {
		matrix.push([]);
		for (let j = 0; j < 9; j++) {
			matrix[i].push(Number(code[i * 9 + j]));
		}
	}
    return matrix
}

export function sencodeParser(sencode){
	let matrix = [];
	for (let i = 0; i < 9; i++) {
		matrix.push([]);
		for (let j = 0; j < 9; j++) {
			matrix[i].push(Number(sencode[i * 9 + j]));
		}
	}
    return matrix
}